import React from 'react';

const MenuButton = ({ isBox3Visible, toggleBoxVisibility, handleCloseButtonClick }) => {

    return (
        <div>
            <button className="header-btn" onClick={toggleBoxVisibility}><img src="icons/bars-solid.svg" alt="Shopping Bag" className="icon shopping-btn"></img><span className="shopping-btn"> Menu</span></button>

            {isBox3Visible && (
                    <div>

                        <button className="cart-close-btn cart-close-btn-layout" onClick={handleCloseButtonClick}><img src="icons/xmark-solid.svg" alt="X Mark" className="icon cart-close-btn"></img><span className="cart-close-btn"> Close Cart</span></button>

                        <ul>
                            <li>Brushes</li>
                        </ul>

                    </div>

            )}
        </div>
    );
};

export default MenuButton;
